import React from "react";
import "./App.css";
import Title from "../title/Title";
import CurrentDateTime from "../current-date-time/CurrentDateTime";

function App() {
  return;
  <React.Fragment>
    <header>
      <a className="banner" href="/">
        <Title text="mimaflow Player" />
      </a>
    </header>
    <footer />
  </React.Fragment>;
}

export default App;
